import styled from "@emotion/styled";

export const Container = styled.div`
margin: 20px;
padding: 40px;
background-color: #9fe1ed;
text-align: center;
border-radius: 8px;
color: #01323b;`

export const Avatar = styled.img` 
width: 200px;
height: 200px;
background-color: #079ab5;
`
